import React from 'react'
import s from './Java.module.css';

const SotweatDev = () => {
    return (
        <div className={s.Java}>
            <h1>Проектирование архитектуры программного продукта</h1>
            <div className={s.GeneralText}>
                <p>В рамках данной работы необходимо спроектировать архитектуру программного продукта и его интерфейс на основе существующих аналогов и запросов целевой аудитории.</p>
            </div>
        </div>
    );
}


export default SotweatDev;
